Творческое объединение "ЮСТАС" - это дружная команда профессионалов, с многолетним опытом в фото- видео съемке. Мы предлагаем широкий спектр услуг: 
- фотосъемка; 
- видеосъемка торжеств; 
- монтаж видео; 
- печать фото; 
- оцифровка видеокассет; 
- аренда ЖК панелей; 
     Индивидуальный подход к каждому клиенту, творческая работа над каждым кадром, использование последних моделей фото-видео-техники, оперативность и профессионализм фотографов и видео операторов, - вот залог успешной работы на протяжении уже 15 лет. 
      У каждого в жизни есть такие моменты, которые хочется переживать снова и снова, будь то рождение новой семьи, крестины и день рождения вашего ребенка, юбилей. Сотрудники "ЮСТАС" помогут создать праздничную атмосферу и сохранить дорогие сердцу воспоминания на долгие годы.

